import React from 'react';

function Services() {
  return (
    <div className="services">
      <h2>Our Services</h2>
      <ul>
        <li>IT Infrastructure Design</li>
        <li>Cloud Solutions</li>
        <li>Network Security</li>
        <li>System Integration</li>
      </ul>
    </div>
  );
}

export default Services;
